// Navbar.tsx
import React from 'react';
//import { Link as RouterLink } from 'react-router-dom';
//import logo from '../../assets/school_42.jpeg';
import './styles.css';

function Navbar() {
  return (
    <nav>
      <a href="#">HOME</a>
      <a href="#">GAME</a>
      <a href="#">GUITAR</a>
      <div id="indicator"></div>
    </nav>
  );
}

export default Navbar;
